"use strict";(self.webpackChunkdocusaurus=self.webpackChunkdocusaurus||[]).push([[467],{43679:(e,t,n)=>{n.r(t),n.d(t,{assets:()=>c,contentTitle:()=>s,default:()=>d,frontMatter:()=>o,metadata:()=>r,toc:()=>l});var a=n(24246),i=n(71670);const o={},s=void 0,r={id:"my/public/health/pest/cockroach",title:"cockroach",description:"repellent",source:"@site/docs/my/public/health/pest/cockroach.md",sourceDirName:"my/public/health/pest",slug:"/my/public/health/pest/cockroach",permalink:"/note/docs/my/public/health/pest/cockroach",draft:!1,unlisted:!1,tags:[],version:"current",frontMatter:{},sidebar:"mySidebar",previous:{title:"fruit",permalink:"/note/docs/my/public/health/fruit"},next:{title:"pollen",permalink:"/note/docs/my/public/health/pollen"}},c={},l=[{value:"repellent",id:"repellent",level:3},{value:"immediate solution",id:"immediate-solution",level:3},{value:"long term solution",id:"long-term-solution",level:3}];function h(e){const t={a:"a",em:"em",h3:"h3",p:"p",...(0,i.a)(),...e.components};return(0,a.jsxs)(a.Fragment,{children:[(0,a.jsx)(t.h3,{id:"repellent",children:"repellent"}),"\n",(0,a.jsx)(t.p,{children:"no effective ones found  via en extensive search  [2014-08-28 \u56db]"}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.a,{href:"http://portal.nifa.usda.gov/web/crisprojectpages/0057199-integrated-pest-management-ipm-strategies-for-the-german-cockroach-and-its-allergens.html",children:"http://portal.nifa.usda.gov/web/crisprojectpages/0057199-integrated-pest-management-ipm-strategies-for-the-german-cockroach-and-its-allergens.html"}),"\nso this means I can use insecticides as repellents?  (no, for German only in lab)\nThe normal activity rhythms and tactic responses of the German\ncockroach Blattella germanica to selected insecticidal spray\nconstituents have been defined in the laboratory. German cockroaches,\ngiven the chance of entering or avoiding dark areas that had been\ntreated with either nontoxic or toxic constituents at sublethal\nlevels, were either highly repelled during initial trials or learned\nto avoid treated areas after 4-10 trials. Repellency was found to be\nthe most important factor affecting the efficacy of insecticides. All\nbuildings treated 15 years ago for protection against subterranean\ntermites were found to be free of termites even though less than 15%\nof the original theoretical residue remained. See IND 01719 for\nmovement."]}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.a,{href:"http://www.openagricola.nal.usda.gov/Record/IND89020186",children:"http://www.openagricola.nal.usda.gov/Record/IND89020186"}),"\nCedar flake boards may be useful as a repellent in indoor cockroach integrated pest management."]}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.a,{href:"http://www.ncbi.nlm.nih.gov/pubmed/17883004",children:"http://www.ncbi.nlm.nih.gov/pubmed/17883004"}),"   a thailand study\nThe essential oil derived from Citrus hystrix showed the best\nrepellency over other candidate essential oils and naphthalene. The\nessential oil of Citrus hystrix exhibited complete repellency (100%)\nagainst P. americana and B. germanica, and also showed the highest\nrepellency (among the essential oils tested) of about 87.5% against\nN. rhombifolia under laboratory conditions. In the field, Citrus\nhystrix essential oil formulated as a 20% active ingredient in ethanol\nand some additives provided satisfactory repellency of up to 86%\nreduction in cockroaches, mostly P. americana and N. rhombifolia with\na residual effect lasting a week after treatment. Citrus hystrix\nessential oil has good potential for being used as a cockroach\nrepellent. Further improvements in efficacy and residual activity may\nbe realized with appropriate formulations."]}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.a,{href:"http://www.reeis.usda.gov/web/crisprojectpages/0212645-identification-and-use-of-essential-oils-for-management-of-urban-insect-pests-in-alabama.html",children:"http://www.reeis.usda.gov/web/crisprojectpages/0212645-identification-and-use-of-essential-oils-for-management-of-urban-insect-pests-in-alabama.html"}),"\ndidn't see result\n",(0,a.jsx)(t.a,{href:"https://en.wikipedia.org/wiki/Electronic_pest_control",children:"https://en.wikipedia.org/wiki/Electronic_pest_control"}),"\nUltrasonic devices were highly effective on crickets while the same\ndevices had little repellent effect on cockroaches.\nCockroaches respond to electronic pest control devices by moving about\na bit more than usual, but don't appear eager to escape from the sound\nwaves. This includes devices that emit uniform frequency as well as\nchanging frequencies of ultrasound."]}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.a,{href:"https://fortress.wa.gov/ecy/publications/publications/97424.pdf",children:"https://fortress.wa.gov/ecy/publications/publications/97424.pdf"}),"\nIneffective methods:\nUltrasonic Devices\nDevices that emit sound beyond the human range of hearing\nare advertised as a way to repel a variety or insects or animals. In\n1984 the Federal Trade Commission studied them and determined\nthey do not work.\n",(0,a.jsx)(t.a,{href:"http://en.wikipedia.org/wiki/Catnip#Repellent",children:"http://en.wikipedia.org/wiki/Catnip#Repellent"}),"\njust one study, not sure how effective it is"]}),"\n",(0,a.jsx)(t.p,{children:"limit its ranges\nrepellent?\nno good one"}),"\n",(0,a.jsxs)(t.p,{children:["so boric acid seems neither repellant nor attractor for cockroaches\n",(0,a.jsx)(t.a,{href:"http://www2.ca.uky.edu/entomology/entfacts/ef614.asp",children:"http://www2.ca.uky.edu/entomology/entfacts/ef614.asp"})]}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.a,{href:"http://www.wikihow.com/Get-Rid-of-Roaches",children:"http://www.wikihow.com/Get-Rid-of-Roaches"}),"\nNatural roach repellents are peppermint oil, cucumber peel, citrus, catnip, garlic, and clove oil."]}),"\n",(0,a.jsx)(t.h3,{id:"immediate-solution",children:"immediate solution"}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.a,{href:"http://portal.nifa.usda.gov/web/crisprojectpages/0057199-integrated-pest-management-ipm-strategies-for-the-german-cockroach-and-its-allergens.html",children:"http://portal.nifa.usda.gov/web/crisprojectpages/0057199-integrated-pest-management-ipm-strategies-for-the-german-cockroach-and-its-allergens.html"}),"\nSticky traps have been found to be the most effective in monitoring\nGerman cockroach populations, but have not generally been found to\nbe effective in population reduction."]}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.a,{href:"https://en.wikipedia.org/wiki/Roach_bait#Boric_acid",children:"https://en.wikipedia.org/wiki/Roach_bait#Boric_acid"}),"\nnon toxic"]}),"\n",(0,a.jsx)(t.p,{children:"clean, remove nest"}),"\n",(0,a.jsx)(t.p,{children:(0,a.jsx)(t.a,{href:"https://fortress.wa.gov/ecy/publications/publications/97424.pdf",children:"https://fortress.wa.gov/ecy/publications/publications/97424.pdf"})}),"\n",(0,a.jsx)(t.p,{children:"Thermal treatments"}),"\n",(0,a.jsx)(t.p,{children:"Boric acid pastes which include a food attractant can be\napplied to cracks and crevices. Because they are less irritating to\napply than dusts, a mask or goggles are not needed. Pastes must\nbe applied thinly so that roaches have room to get into a crack and\neat the bait. It takes 3 to 4 weeks for the results to show. Warning!\nBoric acid also is sold in tablet form, but should not be used in a\nschool, because the tablets look like candy to children."}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.a,{href:"https://en.wikipedia.org/wiki/Roach_bait",children:"https://en.wikipedia.org/wiki/Roach_bait"}),"\nCockroaches live in nests. As such, killing a few roaches that happen\nto wander into a trap is an inadequate means of controlling the\npest. Even if all adult roaches outside the nest are killed, some live\neggs will remain in the nest and eventually hatch, leading to\nexponential growth."]}),"\n",(0,a.jsx)(t.p,{children:"The main problem with controlling infestations of cockroaches is\nensuring that enough insecticide gets to a sufficiently large\nproportion of the population to effect control.\nso use bait first, trap later?"}),"\n",(0,a.jsx)(t.p,{children:"\u7528\u5f00\u6c34\u70eb\u6b7b\u5c0f\u5f3a\u6700\u65b9\u4fbf\uff0c\u7b2c\u4e00\u4e0d\u4f1a\u6709\u88c2\u5f00\u751a\u81f3\u6d82\u4e86\u4e00\u5730\u7684\u5c38\u4f53\uff0c\u53ea\u6709\u4e00\u4e2a\u5b8c\u6574\u7684\u3002\u7b2c\u4e8c\u8fc5\u901f\uff0c\u4e00\u70eb\u5c31\u6b7b\uff0c\u800c\u4e14\u5c0f\u5f3a\u8eb2\u4e0d\u5f00\uff0c\u56e0\u4e3a\u79bb\u5b83\u6bd4\u8f83\u8fdc\uff0c\u5b83\u611f\u5e94\u4e0d\u5230\u3002"}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.a,{href:"http://www.guokr.com/question/567740/",children:"http://www.guokr.com/question/567740/"}),"\n\u6240\u4ee5\u9664\u975e\u4f60\u7528\u62d6\u978b\u62cd\u6b7b\u87d1\u8782\uff0c\u5256\u5f00\u80a0\u9053\uff0c\u628a\u91cc\u9762\u7684\u4e1c\u897f\u62a0\u51fa\u6765\u5403\u6389\uff0c\u5426\u5219\u4e0d\u4f1a\u751f\n\u75c5\u3002\u5c31\u7b97\u8fd9\u6837\uff0c\u80a0\u9053\u91cc\u7684\u5fae\u751f\u7269\u4e5f\u591a\u662f\u87d1\u8782\u81ea\u8eab\u7684\u80a0\u9053\u5171\u751f\u5fae\u751f\u7269\uff0c\u4e0d\u89c1\u5f97\u6709\u591a\n\u5c11\u81f4\u75c5\u83cc\u3002\u5982\u679c\u8fd9\u53ea\u87d1\u8782\u88ab\u643a\u5e26\u75c5\u539f\u4f53\u7684\u4eba\u6216\u52a8\u7269\u7684\u6392\u6cc4\u7269\u6c61\u67d3\u90a3\u5c31\u662f\u53e6\u5916\u4e00\u56de\n\u4e8b\u4e86\u3002\u4e0d\u7ba1\u90a3\u79cd\u60c5\u51b5\uff0c\u4e0d\u8981\u5403\u5b83\u7684\u5c38\u4f53\uff0c\u628a\u978b\u5e95\u548c\u5730\u677f\u6e05\u6d01\u4e00\u4e0b\u5c31\u6ca1\u95ee\u9898\u4e86\u3002"]}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.a,{href:"http://www.wikihow.com/Get-Rid-of-Roaches",children:"http://www.wikihow.com/Get-Rid-of-Roaches"}),"\nFor an 'instant' kill a spray of alcohol (either rubbing alcohol in a\nspray bottle or aftershave in a spray, as long as it contains alcohol)\nworks very well. Hairspray works too.\nreally?"]}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.a,{href:"http://lancaster.unl.edu/enviro/pest/factsheets/120-94.htm",children:"http://lancaster.unl.edu/enviro/pest/factsheets/120-94.htm"}),"\nIt is almost impossible to get rid of all the roaches with traps alone\nso you will need to use some other control methods, too."]}),"\n",(0,a.jsx)(t.p,{children:"For German and brownbanded cockroaches, set bait stations next to\nwalls and flush in corners. For American and oriental cockroaches set\nbait stations in the basement near floor or sewer drains or in damp\ncrawl spaces."}),"\n",(0,a.jsxs)(t.p,{children:["soapy foam to drown it\nnot that effective, it at best slows it down\n",(0,a.jsx)(t.a,{href:"http://zh.wikipedia.org/wiki/%E8%9F%91%E8%9E%82#.E6.AE.BA.E6.BB.85.E8.9F.91.E8.9E.82.E6.96.B9.E6.B3.95",children:"http://zh.wikipedia.org/wiki/\u87d1\u8782#.E6.AE.BA.E6.BB.85.E8.9F.91.E8.9E.82.E6.96.B9.E6.B3.95"}),"\nmany measures are just rumors"]}),"\n",(0,a.jsx)(t.p,{children:"light to prevent it coming out\nnot seem to work as of [2014-08-28 \u56db]"}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.a,{href:"http://en.wikipedia.org/wiki/Cockroach",children:"http://en.wikipedia.org/wiki/Cockroach"}),"\nCockroaches are mainly nocturnal and will run away when exposed to\nlight. A peculiar exception is the Asian cockroach, which is attracted\nto light."]}),"\n",(0,a.jsx)(t.p,{children:"bottle\nsoda bottle  (cut)"}),"\n",(0,a.jsx)(t.p,{children:"\u628a\u4e00\u76c6\u6c34\u653e\u5728\u87d1\u8782\u7ecf\u5e38\u51fa\u6ca1\u7684\u5730\u65b9\uff0c\u7279\u522b\u662f\u665a\u4e0a\uff0c\u5c0f\u87d1\u8782\u4f1a\u722c\u4e0a\u76c6\u7684\u91cc\u9762\u7136\u540e\u6389\n\u5165\u6c34\u4e2d\uff0c\u6389\u5165\u6c34\u4e2d\u7684\u87d1\u8782\u5931\u53bb\u4e86\u9646\u5730\u4e0a\u7684\u6d3b\u52a8\u80fd\u529b\uff0c\u51fa\u4e8e\u87d1\u8782\u7684\u672c\u80fd\u5b83\u4f1a\u88c5\u6b7b\uff0c\n\u6f02\u6d6e\u5728\u6c34\u9762\u4e0a\uff0c\u7b2c\u4e8c\u70b9\u6211\u4eec\u53ef\u4ee5\u53d1\u73b0\u6c34\u76c6\u4e2d\u51fa\u73b0\u4e86\u5f88\u591a\u7684\u5c0f\u87d1\u8782\uff0c\u4e0d\u8981\u4ee5\u4e3a\u8fd9\u5199\n\u87d1\u8782\u90fd\u6b7b\u4e86\uff0c\u4e0d\u6b7b\u5c0f\u5f3a\u7684\u540d\u53f7\u53ef\u4e0d\u662f\u7a7a\u6765\u7684\uff0c\u6211\u4eec\u9700\u8981\u628a\u87d1\u8782\u635e\u51fa\u6765\u7528\u888b\u5b50\u88c5\u597d\uff0c\n\u7136\u540e\u5bf9\u87d1\u8782\u8fdb\u884c\u706b\u5316\uff0c\u8fd9\u6837\u624d\u80fd\u5b8c\u5168\u6740\u6b7b\u87d1\u8782\u3002\nbut it doesn't reach nests/eggs if any\nwhy does it climb?"}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.a,{href:"https://en.wikipedia.org/wiki/Roach_bait#Bait_placement",children:"https://en.wikipedia.org/wiki/Roach_bait#Bait_placement"}),"\nFor baiting to be effective, proper placement and techniques are a\nmust. Put baits as close to the nest as possible. A bait just 50 CM\nfurther away from a nest can reduce the amount of bait eaten by\nhalf. If the same amount of bait is used to cover two areas, the area\nwith the greater number of traps will have most bait eaten. One should\navoid spraying insecticides in baited areas, as that can cause the\nbait to become contaminated, thus the roaches would likely avoid\nconsuming it. Baits, gels and Insect Growth Regulators can be useful\nin many cases.\nBait placed in the open, away from a wall, is essentially\nnon-effective because cockroaches are less likely to locate it. Twice\nas much food per day was consumed when it was next to a nest rather\nthan 50 CM away.[20] A small quantity of bait in many locations\nprovides better control than large quantities in a few locations."]}),"\n",(0,a.jsx)(t.p,{children:"**** [#0]\n\u665a\u4e0a\u57288\u30019\u70b9\u949f\u5de6\u53f3\u53ef\u4ee5\u6bcf\u534a\u5c0f\u65f6\u5728\u87d1\u8782\u591a\u7684\u5730\u65b9\u6253\u5f00\u706f\u8fdb\u884c\u6355\u6740\uff0c\u53ef\u80fd\u4f1a\u6bd4\u8f83\u7d2f\uff0c\u4f46\u662f\u4e5f\u6709\u5f88\u597d\u7684\u6548\u679c\u3002"}),"\n",(0,a.jsx)(t.h3,{id:"long-term-solution",children:"long term solution"}),"\n",(0,a.jsx)(t.p,{children:"seal\nbathroom"}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.a,{href:"http://www.wikihow.com/Get-Rid-of-Roaches",children:"http://www.wikihow.com/Get-Rid-of-Roaches"}),"\nIf you're cheap (or just lazy) and live in a small apartment, you can\nalso use everyday plastic grocery bags as an easy and inexpensive\nalternative to caulking. Simply find cracks and openings along floors,\nwalls, and baseboards where the little buggers might be getting in,\nand stuff one or two bags along each opening to effectively \"seal\"\nit. If this doesn't convince the roaches to find another apartment to\ninvade, it should at least limit the area through which they can enter\nyour space. Use the opportunity to apply other methods of killing and\ntrapping with greater results."]}),"\n",(0,a.jsx)(t.p,{children:(0,a.jsx)(t.a,{href:"http://portal.nifa.usda.gov/web/crisprojectpages/0057199-integrated-pest-management-ipm-strategies-for-the-german-cockroach-and-its-allergens.html",children:"http://portal.nifa.usda.gov/web/crisprojectpages/0057199-integrated-pest-management-ipm-strategies-for-the-german-cockroach-and-its-allergens.html"})}),"\n",(0,a.jsx)(t.p,{children:"Areas with the greatest feeding activity were dark and humid. Areas of less feeding activity were most often well-lit, dry and exposed to human activity.\nFood, water and harborage removal have all been found in the laboratory to impact upon cockroach movement and mortality, with the removal of water having the most immediate impact upon populations."}),"\n",(0,a.jsx)(t.p,{children:"how to monitor roach population?\nsticky trap might attract outside roach in?"}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.a,{href:"http://www.wikihow.com/Get-Rid-of-Roaches",children:"http://www.wikihow.com/Get-Rid-of-Roaches"}),"\nInstall fluorescent light strips or tap lights inside all your kitchen\ncabinets and keep them turned on. Cockroaches don't like light and it\nwill discourage them from munching on food particles and\ncrumbs. Another option is to leave all cabinet doors open and the\nkitchen lights turned on. It won't kill them but it will make your\nhome less inviting.\nwill it work?"]}),"\n",(0,a.jsx)(t.p,{children:"reduce humidity, which is always good"}),"\n",(0,a.jsx)(t.p,{children:"\u4ed4\u7ec6\u7684\u68c0\u67e5\u4e0b\u6c34\u6c9f\uff0c\u5899\u4e0a\u7684\u88c2\u7f1d\uff0c\u5730\u677f\u9694\u53ca\u7a97\u6237\uff0c\u9632\u6b62\u87d1\u8782\u8fdb\u5165\u3002"}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.a,{href:"http://www.wikihow.com/Get-Rid-of-Roaches",children:"http://www.wikihow.com/Get-Rid-of-Roaches"}),"\nCockroaches love piles of wood and other convenient hiding places, and\nas the weather turns colder, they'll migrate inside the house to keep\nwarm. Make sure your woodpile is well away from the house. Remove\npiles of straw, leaves, clippings, and any other yard waste."]}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.a,{href:"https://fortress.wa.gov/ecy/publications/publications/97424.pdf",children:"https://fortress.wa.gov/ecy/publications/publications/97424.pdf"}),"\nThey like cracks and gaps between walls and\nmoldings or around appliances where their body is in contact\nwith the wall or floor surfaces on several sides."]}),"\n",(0,a.jsx)(t.p,{children:"Cockroaches have hiding places in the rooms they infest to\nescape from lights, human activity and cleaning efforts.\nCockroaches like to have their body in contact with something\non at least two sides. Note: Cockroaches can squeeze into\ncracks as small as 1/25 of an inch."}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.a,{href:"http://lancaster.unl.edu/enviro/pest/factsheets/120-94.htm",children:"http://lancaster.unl.edu/enviro/pest/factsheets/120-94.htm"}),"\nRepair leaks, insulate pipes and seal gaps around sinks, tubs and pipes to keep water from getting behind walls.\nSeal gaps around water, gas and heating pipes, both indoors and out.\nImmature (baby) cockroaches live in very tiny cracks. In extreme\ncases, when there are no cracks or crevices available, German and\nbrownbanded roaches can live underneath the labels of canned goods and\neat the glue off the paper labels. To take away these hiding places,\nremove labels and use a marker to label the contents.\nOutside, remove debris and trim ground cover near the building. Move firewood and garbage cans away from the building."]}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.a,{href:"http://en.wikipedia.org/wiki/Cockroach",children:"http://en.wikipedia.org/wiki/Cockroach"}),"\nIt is also helpful to seal off any entry points, such as holes around\nbaseboards, between kitchen cabinets, pipes, doors, and windows with\nsome steel wool or copper mesh and some cement, putty or silicone\ncaulk."]}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.a,{href:"http://www2.ca.uky.edu/entomology/entfacts/ef614.asp",children:"http://www2.ca.uky.edu/entomology/entfacts/ef614.asp"}),"\nBoric acid is one of the most effective cockroach control agents ever\ndeveloped provided that it is used correctly. Unfortunately, most\npeople use it incorrectly, and in the process waste their money and\neffort. Boric acid may be used alone or in combination with the\nbaiting techniques previously discussed."]}),"\n",(0,a.jsx)(t.p,{children:"Unlike many insecticides, boric acid has no repellency to insects and,\nconsequently, roaches return to treated areas repeatedly until they die."}),"\n",(0,a.jsx)(t.p,{children:"Boric acid is deadly to cockroaches, but is low in toxicity to people,\npets and other nontarget animals. It is also odorless and contains no\nvolatile solvents."}),"\n",(0,a.jsx)(t.p,{children:"All species of cockroaches are susceptible to boric acid provided the\npowder is applied into areas where the roaches are living."}),"\n",(0,a.jsx)(t.p,{children:"For best results, the powder should be applied in a very thin layer\nbarely visible to the naked eye. Piles or heavy accumulations will be\navoided by foraging cockroaches much as we would avoid walking through\na snow drift."}),"\n",(0,a.jsxs)(t.p,{children:["Key areas for treatment include under/behind the refrigerator, stove\nand dishwasher, into the ",(0,a.jsx)(t.em,{children:"opening where plumbing pipes enter walls"}),"\n(such as under sinks and behind the commode, shower and washing\nmachine), and into cracks along edges and corners inside cabinets and\npantries. Oftentimes, there is a void (hollow space) under kitchen and\nbathroom cabinets which becomes a hiding place for cockroaches. This\narea can be accessed and treated by injecting powder through any\nexisting gap at the top of the kickplate, or if none is present, by\ndrilling a few small holes."]}),"\n",(0,a.jsx)(t.p,{children:"NEVER apply boric acid onto countertops or other exposed surfaces,\nespecially those used to prepare food."}),"\n",(0,a.jsxs)(t.p,{children:[(0,a.jsx)(t.a,{href:"https://fortress.wa.gov/ecy/publications/publications/97424.pdf",children:"https://fortress.wa.gov/ecy/publications/publications/97424.pdf"}),"\nBoric acid is a very effective stomach poison that can be\napplied by lightly spreading as a scattered dust. It has very\nlittle odor, so it does not repel insects before they come into\ncontact with it.\nAnts, carpet beetles and silverfish which contact it will also be\nkilled. Like the desiccating dusts, it takes several weeks to kill\nmost of the insects."]}),"\n",(0,a.jsx)(t.p,{children:"also the cabinet under basin\nideally nothing there, or things not subject to/retain moisture"})]})}function d(e={}){const{wrapper:t}={...(0,i.a)(),...e.components};return t?(0,a.jsx)(t,{...e,children:(0,a.jsx)(h,{...e})}):h(e)}},71670:(e,t,n)=>{n.d(t,{Z:()=>r,a:()=>s});var a=n(27378);const i={},o=a.createContext(i);function s(e){const t=a.useContext(o);return a.useMemo((function(){return"function"==typeof e?e(t):{...t,...e}}),[t,e])}function r(e){let t;return t=e.disableParentContext?"function"==typeof e.components?e.components(i):e.components||i:s(e.components),a.createElement(o.Provider,{value:t},e.children)}}}]);